  KEY `PRODUCT_ID` (`PRODUCT_ID`),
  CONSTRAINT `PROD_PAR` FOREIGN KEY (`PRODUCT_ID`) REFERENCES `synthesis_product` (`PRODUCT_ID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;
